import BePart from "../containers/BePart/BePart";

const BePartPage = ({ data }) => (
    <BePart producers={data}/>)

BePartPage.getInitialProps = async ctx => {
    const res = await fetch
    const data = await res.json()
    return { data }
}
export default BePartPage
